import { useContext } from "react";
import { UserContext } from "../context";

function Teacher5() {
  const teacher = useContext(UserContext);
  return (
    <div>
      <div>{teacher[4].name}</div>
      <img id='base64image'
       src={'data:image/jpeg;base64,' + teacher[4].image}
       style={{"width": "200px"}}
        />
      <div>{teacher[4].instrument}</div>
      <div>{teacher[4].introduction}</div>
    </div>
  );
};

export default Teacher5;
